    state = {

        Cars: {
            uzb: {
                GM: [
                    {
                        name: "Matiz",
                        price: 3000 + '$',
                    },

                    {
                        name: "Spark",
                        price: 7000 + '$',
                    },

                    {
                        name: "Cobalt",
                        price: 10000 + '$',
                    }
                ],
                UzAutoMotars: [
                    {
                        name: "Lacetti",
                        price: 12000 + '$',
                    },

                    {
                        name: "Gentra",
                        price: 13000 + '$',
                    },

                    {
                        name: "Captiva",
                        price: 20000 + '$',
                    },
                ],
            },
            germaniya: {
                BMW: [
                    {
                        name: "BMW528",
                        price: 46000 + '$',
                    },

                    {
                        name: "BMW745",
                        price: 19000 + '$',
                    },

                    {
                        name: "BMWX6",
                        price: 32000 + '$',
                    },

                ],

                MercedesBenz: [
                    {
                        name: "Mercedes-Benz ML 350",
                        price: 30000 + '$',
                    },
                    {
                        name: "Mercedes-Benz S 550",
                        price: 34000 + '$',
                    },
                    {
                        name: "Mercedes-Benz C 180",
                        price: 5000 + '$',
                    },

                ],
            },
            xitoy: {
                Haval: [
                    {
                        name: "HAVAL JOLION",
                        price: 10000 + '$',
                    },

                    {
                        name: "HAVAL F7",
                        price: 14000 + '$',
                    },

                    {
                        name: "HAVAL H9",
                        price: 29000 + '$',
                    },

                ],

                Lifan: [
                    {
                        name: "LIFAN Breez",
                        price: 6000 + '$',
                    },
                    {
                        name: "LIFAN Cebrium",
                        price: 8000 + '$',
                    },
                    {
                        name: "LIFAN Celliya",
                        price: 10000 + '$',
                    },
                ],
            },
        }

    }


    Show = (event) => {

        let value = event.target.value

        let {GM, UzAutoMotars, } = this.state.Cars.uzb
        let {BMW, MercedesBenz} = this.state.Cars.germaniya
        let {Haval, Lifan} = this.state.Cars.xitoy

        let m = GM[0].name
        let Cobalt = GM[1].name
        let Spark = GM[2].name
        let Lacetti = UzAutoMotars[0].name
        let Gentra = UzAutoMotars[1].name
        let Captiva = UzAutoMotars[2].name
        let BMW528 = BMW[0].name
        let BMW745 = BMW[1].name
        let BMWX6 = BMW[2].name
        let MercedesBenz1 =  MercedesBenz[0].name
        let MercedesBenz2 =  MercedesBenz[1].name
        let MercedesBenz3 =  MercedesBenz[2].name
        let Haava

        

        console.log(GM[0].name);

        if(value === m || value === Cobalt || value === Spark || value === Lacetti || value === Gentra || value === Captiva || value === BMW528 || value === BMW745 || value === BMWX6 || value === MercedesBenz1 || value === MercedesBenz2 || value === MercedesBenz3) {
            alert('yes')

        } else {

            console.log("xato");
        }
        console.log(value);
        
    }







    render() {


        return (
            <div className='Box'>
                <div className='tableBox'>
                    <div className='head'>
                        <h1>Uzbekistan</h1>
                        <h1>Germaniya</h1>
                        <h1>Xitoy</h1>
                    </div>
                    <table>
                        <thead>


                            <tr>
                                <th>GM</th>
                                <th>UzAutoMotars</th>
                                <th>BMW</th>
                                <th>MercedesBenz</th>
                                <th>Haval</th>
                                <th>Lifan</th>
                            </tr>
                        </thead>
                        <tbody>
                            <td>

                                {
                                    this.state.Cars.uzb.GM.map((item, index) => <>
                                        <tr>
                                            <td>{item.name}</td>
                                            <td>{item.price}</td>
                                        </tr>

                                    </>)
                                }
                            </td>

                            <td>
                                {
                                    this.state.Cars.uzb.UzAutoMotars.map((item, index) => <>
                                        <tr>
                                            <td>{item.name}</td>
                                            <td>{item.price}</td>
                                        </tr>
                                    </>)
                                }
                            </td>

                            <td>
                                {
                                    this.state.Cars.germaniya.BMW.map((item, index) => <>
                                        <tr>
                                            <td>{item.name}</td>
                                            <td>{item.price}</td>
                                        </tr>
                                    </>)
                                }
                            </td>

                            <td>
                                {
                                    this.state.Cars.germaniya.MercedesBenz.map((item, index) => <>
                                        <tr>
                                            <td>{item.name}</td>
                                            <td>{item.price}</td>
                                        </tr>
                                    </>)
                                }
                            </td>

                            <td>

                                {
                                    this.state.Cars.xitoy.Haval.map((item, index) => <>
                                        <tr>
                                            <td>{item.name}</td>
                                            <td>{item.price}</td>
                                        </tr>
                                    </>)
                                }

                            </td>

                            <td>
                                {
                                    this.state.Cars.xitoy.Lifan.map((item, index) => <>
                                        <tr>
                                            <td>{item.name}</td>
                                            <td>{item.price}</td>
                                        </tr>
                                    </>)
                                }
                            </td>

                        </tbody>

                        <div className='btn'>
                            <input type="text" onInput={this.Show} />
                        </div>




                    </table>
                </div>
            </div>
        )
    }
}
